import React from "react";
import HeroMiddle from "../../components/HeroMiddle/HeroMiddle";
import "./Home.scss";
import About from "../../components/AboutUs/About";
import ProjectSection from "../../components/ProjectsSection/ProjectSection";
import Testimoanials from "../../components/Testimonials/Testimonials";

const Home = () => {
  return (
    <div className="max-w-7xl m-auto">
      <HeroMiddle />
      <About />
      <ProjectSection />
      <Testimonials />
    </div>
  );
};

export default Home;
